title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o3565.m6 -> o3617.m7 -> o3565.m6
  o3617.m7 -> o3565.m6 -> o3617.m7
  o3617.m5 -> o3565.m6 -> o3617.m7 -> o3565.m6

features:
  - inheritance
  - overriding
  - method
  - polymorphism

